(17, 17, 'timeline', '', 'URGENTE: El ex-Gobernador de las Islas Malvinas, Rex Hunt, acaba de aterrizar en Londres (FOTO) ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(18, 18, 'timeline', '', 'En estos momentos: Tanques argentinos se trasladan por las calles de Puerto Argentino ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(19, 19, 'timeline', '', 'Ayer en La Razn &gt; El Jockey Club evoca el centenario de su fundacin en momentos histricos para la Patria #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(20, 20, 'timeline', '', 'El Jefe del Estado Mayor, Vaquero, arrib a Malvinas para interiorizarse acerca de las necesidades de las tropas argentinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(21, 21, 'timeline', '', 'Comandante de brigada, Amrico Daher, rest importancia al bloqueo naval. "el problema lo van a tener ellos; no saben lo que les espera"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(22, 22, 'timeline', '', 'Segn estimaciones, esta medida redoblar el nmero de "Harrier" (aviones de despegue vertical) en el Atlntico Sur', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(23, 23, 'timeline', '', 'Gran Bretaa anunci que requis otro buque mercante para reforzar la "Task Force". Transportar aviones "Harrier"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(24, 24, 'timeline', '', 'Urgente: Costa Mndez declar que las negociaciones con UK siguen vigentes pero "no se registraron progresos"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(25, 25, 'timeline', '', 'En nuestro sitio, una seleccin de los temas ms importantes de la semana (8 al 14 de abril) &gt;&gt;  #1982', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(26, 26, 'timeline', '', 'Hoy en La Nacin &gt; Argentina sostiene que el cese de hostilidades est quebrado por Gran Bretaa #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(27, 27, 'timeline', '', 'Gob de Costa Rica reiter su "reconocimiento y apoyo a los derechos soberanos de la Argentina sobre las islas Malvinas"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(28, 28, 'timeline', '', 'Se intensific puente areo e/ Malvinas y aeropuertos de C. Rivadavia y Ro Gallegos. La Armada mantiene el control sobre el Mar Argentino', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(29, 29, 'timeline', '', 'Canciller brasileo afirm que no aceptarn sugerencia de Thatcher para influenciar a Arg y obtener retiro de tropas de Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(30, 30, 'timeline', '', 'APOYO: ante posibles hostilidades, Panam convoc al Consejo de Seguridad para "detener la agresin contra la Argentina"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(31, 31, 'timeline', '', 'Por una solucin pacfica: Haig anunci que maana viajar a BsAs', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(32, 32, 'timeline', '', 'Oficial: la Comunidad Econmica Europea acord prohibir la importacin de productos argentinos durante un mes a partir de 16/04', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(33, 33, 'timeline', '', 'Hoy en Diario Popular &gt; Cien mil hombres en pie de guerra. Las Malvinas son "una fortaleza inexpulgable" #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(34, 34, 'timeline', '', 'Hoy en Ro Negro &gt; Haig informa hoy a Reagan y despus viajara a Buenos Aires #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(35, 35, 'timeline', '', 'Soldado argentino transportando su equipo, esta tarde en Puerto Argentino (FOTO) ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(36, 36, 'timeline', '', 'Hoy en La Nacin &gt; Haig suspendi su regreso a nuestro pas. #Malvinas atraviesa un punto extremadamente grave #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(37, 37, 'timeline', '', 'Argentina no cesar las compras a la CEE. Secretario de Comercio afirm que "Mientras se puedan sustituir se sustituirn"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(38, 38, 'timeline', '', 'La Unin Sovitica defendi a la Argentina y acus a la Comunidad Econmica Europea por "violacin del derecho internacional"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(39, 39, 'timeline', '', 'Noruega y Suecia no se unirn al embargo de las importaciones de la Argentina acordado por la Comunidad Econmica Europea', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(40, 40, 'timeline', '', 'Comandante en Jefe de la Fuerza Area Arg confa en encontrar solucin diplomtica y se prepara para enfrentar "cualquier eventualidad"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(41, 41, 'timeline', '', 'Partiendo del "reconocimiento de que las Malvinas pertenecen a la Argentina", el presidente panameo Arstides Royo ratific su APOYO', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(42, 42, 'timeline', '', 'Vocero UK: "La fuerza naval de intervencin (Task Force) sigue avanzando hacia los archipilagos con la misin de reconquistarlos"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(43, 43, 'timeline', '', 'URGENTE: tras anuncio de Haig, Margaret Thatcher asegur que la gestin estadounidense "haba fracasado"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(44, 44, 'timeline', '', 'Alexander Haig retorna a Londres. Afirma tener "nuevas ideas" para una solucin pacfica del conflicto por Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(45, 45, 'timeline', '', 'El embajador argentino en la ONU, Eduardo Roca, ratific en NY la posicin negociadora argentina ante el Consejo de Seguridad', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(46, 46, 'timeline', '', 'Hoy en La Prensa &gt; No retornara Haig a Buenos Aires. Pesimismo del secretario por la rgida posicin britnica #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(47, 47, 'timeline', '', 'Hoy en Diario Popular &gt; No bajamos la guardia. La OEA rechaz un proyecto para condenar la posicin argentina #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(48, 48, 'timeline', '', 'Fuentes castrenses aseguraron que LA PROPUESTA FUE RECHAZADA', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(49, 49, 'timeline', '', 'Haig comunic una contrapropuesta aprobada por UK:  gobierno tripartito para las islas entre Argentina, Gran Bretaa y Estados Unidos', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(50, 50, 'timeline', '', 'Haig acaba de comunicarse telefnicamente con Costa Mndez. No retornar a BsAs debido a que UK rechaz la propuesta argentina', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(51, 51, 'timeline', '', 'Representantes de Ecuador, Mxico y Per transmitieron su solidaridad con la causa argentina en la recuperacin de las Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(52, 52, 'timeline', '', 'El consejo de presidentes de la Multipartidaria ratific el APOYO a las Fuerzas Armadas en cuanto a la recuperacin de las Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(53, 53, 'timeline', '', 'HISTRICO: pases latinoamericanos defienden a la Argentina y se levant la sesin del Consejo de la OEA, celebrada en Washington', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(54, 54, 'timeline', '', 'Costa Mndez declar que no hubo avances en la bsqueda de una solucin pacfica con Gran Bretaa por las islas Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(55, 55, 'timeline', '', 'Por Malvinas, Margaret Thatcher convoc a una sesin extraordinaria de la Cmara de los Comunes para el da 14/04', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(56, 56, 'timeline', '', 'En caso de conflicto, Bolivia brindar APOYO armado y logstico a la Arg comunic el comandante de la Fuerza Area Boliviana', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(57, 57, 'timeline', '', 'Canad responde a Gran Bretaa prohibiendo las importaciones de productos argentinos como represalia por la ocupacin de las Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(58, 58, 'timeline', '', 'En nuestro sitio: "Otra historia nunca contada" escrita por un soldado movilizado &gt; ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
